import React , { useState } from 'react'
import axios from 'axios';
import "./register.css";

export default function Register() {

    const [userkaobject , setUser] = useState({
        field1:"",
        field2:"",
        field3:"",
        field4:""
    })

    const registerf = () => {
        const { field1,field2,field3,field4} = userkaobject;
        if(field1 && field2 && field3 && (field4===field3 ))
        {

            alert("Posted Successfully");
            console.log(userkaobject)
            axios.post("http://localhost:9002/register", userkaobject)
            .then(res=>console.log(res)) // even works without this  
        }else{
            alert("Invalid Input");
            console.log("registerf Function mein kuch error aaya hai")
        }
    }

    const handlechange = e => {
        const {name , value} = e.target;
        setUser({
            ...userkaobject,
            [name]:value
        })
    }

  return (

    <div className='register'>
    {console.log(userkaobject)}
    <h1>Register Page</h1>   
    Name : <input onChange={handlechange} value={userkaobject.field1} name="field1" type="text" placeholder='name'/> <br />
    E-Mail : <input onChange={handlechange} value={userkaobject.field2} name="field2" type="text" placeholder='email'/> <br />
    Password : <input onChange={handlechange} value={userkaobject.field3} name="field3" type="password" placeholder='password'/> <br />
    cnfPassword : <input onChange={handlechange} value={userkaobject.field4} name="field4" type="password" placeholder='cnfpassword'/> <br />
    <button onClick={registerf} className="btn"> Register </button>
  </div>
  )
}
